import React from 'react';
import './searchList.scss';

const SearchList = ({ children }) => (
    <div className="searchList">
        <ul className="searchList__ul">
            {children}
        </ul>
    </div>
);

SearchList.propTypes = {
    children: PropTypes.node
}

export default SearchList;
